import React from "react";
// import ReactDOM from "react-dom";

function List() {
  return (
    <ol>
      <li>Lambo</li>
      <li>Ferrarri</li>
      <li>Porshe</li>
      <li>Mutang</li>
    </ol>
  );
}

export default List;
